function replaceImages() {
	// Select all img elements with alt="Solana Mobile"
	const images = document.querySelectorAll('img[alt="Solana Mobile"]');
	const mobilesmart = document.querySelectorAll('img[alt="Symbolized image of two Saga phones floating in front of each other."]');
	const mobilesmart1 = document.querySelectorAll('img[alt="Degen Ape within a symbolized floating phone."]');

	///_next/image?url=%2F_next%2Fstatic%2Fmedia%2Fphone_renders.ee9e2694.png&w=1200&q=75
console.log(images)
	// Get the window width
	const windowWidth = window.innerWidth;
console.log('inling')
	// Loop through each image element
	images.forEach(img => {
		// Create a new Image element
		
		const newImg = new Image();

		// Set the src attribute to 'me.png'
		newImg.src = 'image_4.svg';
		

		// Set the width and height attributes based on window width
		if (windowWidth <= 900) {
			newImg.width = 140;
			newImg.height = 15;
		} else {
			// Set default width and height
			newImg.width = 210;
			newImg.height = 24;
		}
		newImg.classList.add('logo-sol');
		img.removeAttribute('srcset')
		// Replace the original image with the new one
		img.parentNode.replaceChild(newImg, img);
	});
	mobilesmart.forEach(img => {
		// Create a new Image element
		
		const newImg = new Image();

		// Set the src attribute to 'me.png'
		newImg.src = 'mobilesmart.svg';
		newImg.setAttribute('alt', 'Symbolized image of two Saga phones floating in front of each other.');
		// Set the width and height attributes based on window width
		const previousStyles = window.getComputedStyle(img);
		for (const property in previousStyles) {
			if (previousStyles.hasOwnProperty(property)) {
				newImg.style[property] = previousStyles[property];
			}
		}
		
		img.removeAttribute('srcset')
		// Replace the original image with the new one
		img.parentNode.replaceChild(newImg, img);
	});
	mobilesmart1.forEach(img => {
		// Create a new Image element
		
		const newImg = new Image();

		// Set the src attribute to 'me.png'
		newImg.src = 'mobilesmart.svg';
		newImg.setAttribute('alt', 'Symbolized image of two Saga phones floating in front of each other.');
		// Set the width and height attributes based on window width
		const previousStyles = window.getComputedStyle(img);
		for (const property in previousStyles) {
			if (previousStyles.hasOwnProperty(property)) {
				newImg.style[property] = previousStyles[property];
			}
		}
		
		img.removeAttribute('srcset')
		// Replace the original image with the new one
		img.parentNode.replaceChild(newImg, img);
	});
}

// Call replaceImages initially
replaceImages();

setTimeout(replaceImages, 3000);
 // Then

// Add event listener for window resize
window.addEventListener('resize', replaceImages);

